import axios from 'axios';

getItems = async () => {
    let res = await axios.get("https://applefacilities.review.blueriver.com/index.cfm/_api/json/v1/scv/building/?andOpenGrouping&locationCode%5B0%5D=sqo&or&locationCode%5B2%5D=nwr&or&locationCode%5B4%5D=scv&or&locationCode%5B6%5D=sfo&closeGrouping&fields=buildingname,buildingabbr,lat,lng,black,buildingZone&active=1&cachedwithin=600");
    console.log(res.data.data.items[0])
    let { data } = res.data;
    this.setState({ users: data });
};
